import React, { Component } from 'react';

class ToDoList extends Component {
    constructor(){
        super()
        this.state = {
            myList: []
          }
    }

    componentDidMount(){

        this.setState({myList:  ["shoping", "reading"]})
    }

    render() {
        return (

            <ul>
            {this.state.myList.map(function(name, index){
                return <li key={ index }>{name}</li>;
              })}
        </ul>
        );
    }
}

export default ToDoList;
